import React, { Component } from 'react'
import { Grid } from 'semantic-ui-react'
import EventList from '../'

class EventDashboard extends Component {
    render() {
        return (
            <Grid>
                <Grid.Column width={10}>
                    <EventList />
                </Grid.Column>
                <Grid.Column width={6}>
                    <h2>Right Column</h2>
                </Grid.Column>
            </Grid>
        )
    }
}

export default EventDashboard;
